// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.5.0 <0.9.0;

contract bakery{
    address payable thirdParty=payable(0x78731D3Ca6b7E34aC0F824c42a7cC18A495cabaB);
    address payable salesMan=payable (0xAb8483F64d9C6d1EcF9b849Ae677dD3315835cb2);
    address public owner;
    string public meal="Meal have done";

    constructor ()
    {
        owner=msg.sender;
    }

    function getBlance() view public returns(uint)
    {
        return address(this).balance;
    }

    receive() external payable
    {
        require(msg.sender==owner);

    }

    function transf() public 
    {
        // require(msg.sender >= 3 ether);
        thirdParty.transfer(getBlance());
    }

    function getMeal(uint a) public pure returns(bool)
    {
        if (a == 3166282360){
            return true;
        }
        return false;
    }

    function getOrder(address payable _to) public payable returns(address)
    {
        
    }
}

